import './TodoFilter.css';

function TodoFilter({ total, completed }) {
  return (
    <section className='footerFilter'>
      <p>
        All {completed} {total}
      </p>
      <p>
        Active {completed} {total}
      </p>
      <p>
        Completed {completed} {total}
      </p>
    </section>
  );
}

export { TodoFilter };
